import React, { Component } from 'react'
import $ from "jquery";
import { withRouter } from "react-router-dom";

 class Pages extends Component {
    constructor(props) {
        super(props);
        this.state = {
            image: "../images/de.jpg",
            appcode:""
        }
    }
    componentDidMount() {
        const id = this.props.match.params.id;
        this.setState({appcode: id.slice(1,id.length)})
        fetch(this.state.url, {
            method: "POST",
            body: JSON.stringify({
              type: "sort",
              id: id
            }),
            headers: {
              "Content-type": "application/json; charset=UTF-8",
            },
          })
            .then((res) => res.json())
            .then((res) => this.setState({ api: res }));
    }


    render() {
        
        return (
            <div>
                <img src='https://marianadascalitei.dev.ascensys.ro/paltimsalestool/api/appartmentPlans/1A3.12.pdf'></img>
                <div>{this.state.appcode}</div>
            </div>
        )
    }
}
export default withRouter(Pages)
